import { Button, ButtonGroup, Container, Typography } from "@mui/material";
import React from "react";

const FilterTodo = () => {
  // Your challenge is to add a filter to do the following
  // Show completed todos
  // Show incomplete todos
  // Show all todos
  // The todos data structure is as follows

  const todos = [
    {
      id: 1,
      title: "NeoG assignments",
      completed: false,
    },
    {
      id: 2,
      title: "Pair programming session",
      completed: true,
    },
    {
      id: 3,
      title: "Project submission",
      completed: false,
    },
    {
      id: 4,
      title: "Coding practice",
      completed: true,
    },
  ];

  return (
    <Container>
      <Typography variant="h3">Filter Todos</Typography>
      <ButtonGroup variant="filled">
        <Button>Show All Todos</Button>
        <Button>Show Completed Todos</Button>
        <Button>Show Incomplete Todos</Button>
      </ButtonGroup>
    </Container>
  );
};

export default FilterTodo;
